// src/components/EmailList.js
import React from 'react';

const EmailList = ({ emails, setSelectedEmail }) => {
  return (
    <div className="email-list">
      {emails.map(email => (
        <div key={email.id} onClick={() => setSelectedEmail(email)}>
          {email.subject}
        </div>
      ))}
    </div>
  );
};

export default EmailList;
